import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'
import './Projectblock.css'

function Projectblock(props) {
    let param = useParams()
    let [systemarr, setsystemarr] = useState({data:[]})
    let [systemarr2, setsystemarr2] = useState({data:[]})
    let [filter1, setfilter1] = useState([])
    let [filter2, setfilter2] = useState([])

    let [count, setcount] = useState(12)
    let [page, setpage] = useState(0)
    let langarr
    let arry = [];

    useEffect(()=>{

      langarr = param.count.split("-")

    },[param.count])

    useEffect(()=>{

      rendernormal()
    },[])

    useEffect(()=>{

      rerenderprods2()
    },[count])
    useEffect(()=>{

      rerenderprods2()
    },[systemarr])

    function rendernormal(){
      fetch('https://squid-app-9h43v.ondigitalocean.app/api/'+langarr[0]+'-projects')
      .then(res=>res.json())
      .then(json=>{setsystemarr(json)}).then(()=>rerenderprods2())
    }
    
   function rerenderprods2(attrib,idd){
    if(systemarr.data.length > 0){



    for (let i = 0; i < count; i++) {

      try{    
        if(systemarr.data[i]){arry.push(systemarr.data[i])}
        }
      catch{}
  
    }
    
    let imv = {data:[page,arry]}
    console.log(imv)
    setsystemarr2(imv)
    }else{console.log("not yet")}

   }
   function loadsystem(prop){
    console.log(prop)
    let systemurl = "/"+param.count+"/projects/"+prop
    window.location.replace(systemurl)
   }


   function rerendering(){
    if(systemarr2.data.length > 0){
      return(
        <>

        <div className='Wrap'>
          <div>
            <img src={systemarr2.data[count-12].attributes.image1}/>
          </div>
          <div>
            <img src={systemarr2.data[count-11].attributes.image1}/>
          </div>
          <div>
            <img src={systemarr2.data[count-10].attributes.image1}/>
          </div>
          <div>
            <img src={systemarr2.data[count-9].attributes.image1}/>
          </div>

        </div>



        </>
      )
    }else{
      return(
        <>
        </>
      )

    }
   }

   function returncards(index, statss){
    console.log(index)
    if(index%12 == 0){
      console.log("mod")
      return(
        <>
          
          <img  src ={statss.attributes.image1} className="statss1"/>
        </>
      )
    }
    if(index%12 == 1){
      console.log("mod1")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss2"/>
        </>
      )
    }
    if(index%12 == 2){
      console.log("mod2")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss3"/>
        </>
      )
    }
    if(index%12 == 3){
      console.log("mod3")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss4"/>
        </>
      )
    }
    if(index%12 == 4){
      console.log("mod4")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss5"/>
        </>
      )
    }
    if(index%12 == 5){
      console.log("mod5")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss6"/>
        </>
      )
    }
    if(index%12 == 6){
      console.log("mod6")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss7"/>
        </>
      )
    }
    if(index%12 == 7){
      console.log("mod6")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss8"/>
        </>
      )
    }
    if(index%12 == 8){
      console.log("mod6")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss9"/>
        </>
      )
    }
    if(index%12 == 9){
      console.log("mod6")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss10"/>
        </>
      )
    }
    if(index%12 == 10){
      console.log("mod6")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss11"/>
        </>
      )
    }
    if(index%12 == 11){
      console.log("mod6")
      return(
        <>
          <img  src ={statss.attributes.image1} className="statss12"/>
        </>
      )
    }

   }
  return (
    <>
    <div>Systemblock</div>

    <h1>{props.lange}</h1>
    <div className='System-Wrapper'>
    <div className='System-Filter'>
      <h3>Filter:</h3>

      <p>Result(s):{"systemarr.data.length"}</p>
      <div className='System-Filter-Block'>
        <h3>Geländertyp: </h3>
        <br />
       

        <label class="container">
          <input id="ganzglass" type="checkbox" onChange={()=>rerenderprods2("ganzglass", "ganzglass")}  />
          <span class="checkmark"></span> Ganzglasgeländer
        </label>

        <label class="container">
          <input id="pfosten" type="checkbox" onChange={()=>rerenderprods2("pfosten", "pfosten")}  />
          <span class="checkmark"></span> Pfostengeländer
        </label>

        <label class="container">
          <input id="handlauf" type="checkbox" onChange={()=>rerenderprods2("handlauf", "handlauf")}  />
          <span class="checkmark"></span> Wandhandläufe
        </label>

      </div>


      <div className='System-Filter-Block'>

      <label class="container">
          <input id="bodenglasklemmen" type="checkbox" onChange={()=>rerenderprods2("bodenglasklemmen", "bodenglasklemmen")}  />
          <span class="checkmark"></span> Bodenglasklemmen
